nta.declaration:
/* Simulation-specific stuff */
urgent broadcast chan bounce;    // Forces the "bounce" endge to be taken immediately when available
broadcast chan hit;
clock time;        // I don't recall if this clock is necessary but I use it for the end-condition of learning queries.
clock p, v;        // Position (m) and velocity (m/s).
clock x;           // Used to control decision period
int resets = 0;    // The game resets when the ball "dies" i.e. p=0 and |v|<1.
int swings;        // Times the player swings at the ball.
int hits;          // Times those siwings actually affect the state.
const double m = 0.5;     // Mass of the ball (kg). Roughly matches the weight of a basketball.
const double g = 9.81;    // Gravity constant (m/s^2). 

// Energy gained by hitting the ball
double delta_e_mek(double v, double p) {
    double e_mek = m*g*p + 0.5*m*v*v;
    if (v < -4 || p < 4)  {
        return 0;
    }
    if (v < 0) {
        v = -4;
    } else {
        v = -4 - 0.95*v;
    }
    return m*g*p + 0.5*m*v*v - e_mek;
}
